import React, { Component } from 'react';
import '../App.css';

export default class SecondComponent extends Component {
    state = {  }
    render() {
        const {data, key} = this.props;
        return ( 
            <div 
            style={{
                display: 'flex',
                flexDirection: 'column',
                flex: 1,
                border: "1px solid black",
            }}
            >
                <ul key={key} style={{marginLeft: '3%', marginRight: '2%'}}>
                        <p>{data.day}</p>
                </ul>
                 </div>
         );
    }
}
